import React from 'react';
// eslint-disable-next-line @repo/internal/react/no-class-components
export class AnnotationViewWrapper extends React.PureComponent {
  componentDidMount() {
    const {
      onViewed
    } = this.props;
    if (onViewed) {
      onViewed();
    }
  }
  render() {
    return this.props.children;
  }
}